import React from "react";
import { Table } from "reactstrap";
import Customer from "./Customer";

function Allcustomer() {

    return (
        <div>
            <Table striped>
                <thead>
                    <tr>
                        <th>Customer Id</th>
                        <th>Customer Name</th>
                        <th>Mobile Number</th>
                        <th>City</th>
                    </tr>
                </thead>
            </Table>
        </div>
    )
}

export default Allcustomer
